	[100521] = [[{100521, "日记21", 100521, 35, 6, 0, 1, 5, 1, 0, {}, {{effect_type=40,val=100521}}, {}, {}, "我相信世界不会偏爱那些懒惰的人或者狗，也绝不会怠慢勤奋的那些。", 0, 0, 2, {}, 0, 0, 0, {}, "", "《偏爱与怠慢》", 0, 0}]],
