	[100519] = [[{100519, "日记19", 100519, 35, 6, 0, 1, 5, 1, 0, {}, {{effect_type=40,val=100519}}, {}, {}, "人们不断地努力，都是为了强大到让世界无法改变自己，对吧？", 0, 0, 2, {}, 0, 0, 0, {}, "", "《努力的意义》", 0, 0}]],
